import { StyleSheet } from 'react-native';

const estiloRotasDrawer = StyleSheet.create({
  fotoContainer: {
    width: '100%',
    height: 150,
    alignItems: 'center',
    justifyContent: 'center',
    marginTop: 15
  },
  foto: {
    width: 100,
    height: 100,
    borderRadius: 50
  },
  nome: {
    color: '#000',
    fontSize: 18,
    marginTop: 5,
    marginBottom: 25
  }
});

export default estiloRotasDrawer;
